import React, { useState } from 'react';
import './NavBar.css';
import { Link } from 'react-router-dom';

const Nav = ({ handleChange, handleSubmit }) => {
  // const [show, handleShow] = useState(false);

  return (
    // <div className={`nav ${show && 'nav_black'}`}>
    <div className="nav">
      <Link to='/homePage'>
        <img
          className='nav_logo'
          src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQ5uaj5DOEA_dE7pOGFOtlFWjSx7REGmeKbWA&usqp=CAU"
          alt="Perrito inicio"
        />
      </Link>
      <div className='nav_links'>
        <Link className='nav_link_to' to='/'> <button className='link_button'> Landing </button></Link>
        <Link className='nav_link_to' to='/form'><button className='link_button'> Create </button></Link>
      </div>
      <div>
        <form onSubmit={handleSubmit} className='search_form'>
          <input
            className='input_search'
            type="search"
            placeholder='Search by name or Id'
            onChange={handleChange}
          />
          <button className='submit_button' type="submit">Search</button>
        </form>
      </div>
    </div>
  );
}

export default Nav;
